        if str1[i - 1] == str2[j - 1]:
            lcs[len_lcs - 1] = str1[i - 1]
            i -= 1
            j -= 1
            len_lcs -= 1
        elif dp[i - 1][j] > dp[i][j - 1]:
            i -= 1
        else:
            j -= 1
    return (dp[-1][-1], ''.join(lcs))

